import React from "react";
import catHeader from "../../images/cat-header.png";
import Searchbar from "../searchbar/Searchbar";

const Navbar = () => {
  return (
    <>
      <nav>
        <div className="">
          <img src={catHeader} alt="Cat Header " className="brightness-50 " />
        </div>
        <Searchbar />
        <div className="absolute top-0 left-0 flex py-6 w-full justify-between mx-auto max-w-[1920px] ">
          <h1 className="px-10 text-4xl font-bold text-white mb-4">CatLy</h1>
          <ul className="flex pr-10 text-white">
            <li className="px-4 pt-4">Home</li>
            <li className="px-4 pt-4">About Us</li>
            <li className="px-4 pt-4">Contact</li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
